INSERT INTO `ps_product_lang` VALUES (386,1,1,'A+X shakes things up with its first book-length story as Captain America and Cyclops find themselves on a collision course! Cap is hell-bent on arresting the fugitive Cyclops, but that‚Äôs only half of this duo‚Äôs troubles. They also need to defeat a horde of menacing Skrulls and find Professor X‚Äôs former students, the Skrull mutants known as Cadre K! But there‚Äôs more! Emma Frost and Black Widow team up in a steamy saga! Magneto encounters the Superior Spider-Man! Dr. Strange and Beast face a truly insane threat! A heartbreaking story from the past of Spider-Man and Psylocke! Iron Man teams with fan-favorite X-student Broo! And Brian Michael Bendis pens a very special A+X tale! Featuring the Marvel writing debut of Max Bemis of the band Say Anything and Jeff Loveness, Emmy-nominated writer for Jimmy Kimmel Live! Collecting A+X #13-18.','A PLUS X TP VOL 03 EQUALS OUTSTANDING (9780785190110)','marvel-comics','','','MARVEL COMICS','A PLUS X TP VOL 03 EQUALS OUTSTANDING (9780785190110)','','','',''),(387,1,1,'Marvel‚Äôs most amazing heroes step into the spotlight in this all-action book packed with adventure, danger, drama‚Ä¶ and fun! Black Widow seeks redemption for her past ‚Äî in ways the Avengers wouldn‚Äôt approve! Carol Danvers takes on the legacy of Captain Marvel and lives her dream of traveling to the stars! Teenager Kamala Khan fights crime as Ms. Marvel ‚Äî but is she ready for this dangerous new life? She-Hulk isn‚Äôt just a green powerhouse ‚Äî her skills as an attorney will knock her opponents‚Äô socks off! A mysterious woman wields the enchanted hammer Mjolnir, and claims the powers of the mighty Thor! And Squirrel Girl faces her greatest challenge yet: college! Whatever your tastes, there‚Äôs something here for everyone! Collecting BLACK WIDOW (2014) #1, CAPTAIN MARVEL (2014) #1, MS. MARVEL (2014) #1, SHE-HULK (2014) #1, THOR (2014) #1 and UNBEATABLE SQUIRREL GIRL #1.','A-FORCE PRESENTS TP VOL 01 (9780785198987)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 01 (9780785198987)','','','',''),(388,1,1,'The Marvel heroes everyone is talking about continue their epic adventures! Black Widow stages a daring jailbreak from a South American prison! In the midst of an alien uprising, will Captain Marvel defy the Avengers and side with the underdogs? Find out why Kamala Khan, the new Ms. Marvel, is the most lovable (but awkward) new hero around! When her client, the son of Doctor Doom, seeks asylum, She-Hulk will go to the ends of the earth for justice! What happens when the all-new Thor is separated from her hammer? And Squirrel Girl battles Galactus on the moon! (Yup, you read that right!) It‚Äôs cover-to-cover suspense, heroics and fun! Collecting BLACK WIDOW (2014) #3, CAPTAIN MARVEL (2014) #3, MS. MARVEL (2014) #3, SHE-HULK (2014) #3, THOR (2014) #3 and THE UNBEATABLE SQUIRREL GIRL (2015) #3.','A-FORCE PRESENTS TP VOL 03 (9780785199007)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 03 (9780785199007)','','','',''),(389,1,1,'The Marvel Universe‚Äôs most exciting action heroes continue their adventures! Black Widow discovers a deadly plot that spans the globe! Captain Marvel sets out to find the real reason behind the resettlement of Rocket Girl‚Äôs people! Ms. Marvel learns a secret about her new powers as she investigates the Inventor! She-Hulk‚Äôs client, Kristoff Vernard, has been kidnapped by his father: Doctor Doom! The new Thor is adjusting to life as a hero, but the original Odinson wants his hammer back! And the final showdown between Squirrel Girl and Galactus is here! Six kick-butt heroes, six epic adventures ‚Äî comics don‚Äôt get any better than this! Collecting BLACK WIDOW (2014) #4, CAPTAIN MARVEL (2014) #4, MS. MARVEL (2014) #4, SHE-HULK (2014) #4, THOR (2014) #4 and UNBEATABLE SQUIRREL GIRL (2015) #4.','A-FORCE PRESENTS TP VOL 04 (9780785195337)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 04 (9780785195337)','','','',''),(390,1,1,'Amazing heroes in astonishing adventures! Black Widow races against time to thwart a dark plot threatening Europe. Captain Marvel rebels against an empire and declares a star war! Jersey City‚Äôs new sensation, Ms. Marvel, hones her powers ‚Äî and her costume! She-Hulk and Hellcat delve deep into the mysterious Blue File, and dig up a Marvel Universe-wide conspiracy! The all-new Thor has her hands full with Absorbing Man and Titania ‚Äî not to mention the de-hammered Odinson and his ever-cranky All-Father! Plus: Thrill to a selection of strange tails of the unbeatable Squirrel Girl! They‚Äôre a force to be reckoned with, and the ‚ÄúA‚Äù stands for ‚Äúawesome!‚Äù Collecting BLACK WIDOW (2014) #5, CAPTAIN MARVEL (2014) #5, MS. MARVEL (2014) #5, SHE-HULK (2014) #5, THOR (2014) #5 and THE UNBEATABLE SQUIRREL GIRL (2015A) #5.','A-FORCE PRESENTS TP VOL 05 (9781302901936)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 05 (9781302901936)','','','',''),(391,1,1,'Marvel‚Äôs most awesome heroes continue their adventures! Black Widow‚Äôs strength and cunning will be tested to their limits as she takes on a mission too dangerous for S.H.I.E.L.D.! Let battle commence as Captain Marvel wades into an interplanetary turf war! Ms. Marvel checks off another super hero rite of passage: a team-up with Wolverine! As the mysterious Blue File turns friend into foe, who can She-Hulk trust? The Odinson continues to narrow down the possible answer to the question on everyone‚Äôs lips: Who is the new Thor? And Squirrel Girl meets Girl Squirrel ‚Äî and also a hippo! Grade A excitement, guaranteed! Collecting BLACK WIDOW (2014) #6, CAPTAIN MARVEL (2014) #6, MS. MARVEL (2014) #6, SHE-HULK (2014) #6, THOR (2014) #6 and UNBEATABLE SQUIRREL GIRL (2015A) #6.','A-FORCE PRESENTS TP VOL 06 (9781302902124)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 06 (9781302902124)','','','',''),(392,1,1,'Najpotworniejsze kreacje Jacka Kirby‚Äôego o